selector_to_html = {"a[href=\"#syntax-highlighting\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Syntax highlighting<a class=\"headerlink\" href=\"#syntax-highlighting\" title=\"Link to this heading\">#</a></h3><p>Apply syntax highlighting to fenced code blocks with the <code class=\"docutils literal notranslate\"><span class=\"pre\">highlight</span></code> option:</p>", "a[href=\"#markdown-it-for-enterprise\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">markdown-it for enterprise<a class=\"headerlink\" href=\"#markdown-it-for-enterprise\" title=\"Link to this heading\">#</a></h2><p>Available as part of the Tidelift Subscription.</p><p>The maintainers of <code class=\"docutils literal notranslate\"><span class=\"pre\">markdown-it</span></code> and thousands of other packages are working with Tidelift to deliver commercial support and maintenance for the open source dependencies you use to build your applications. Save time, reduce risk, and improve code health, while paying the maintainers of the exact dependencies you use. <a class=\"tippyAnchor reference external\" href=\"https://tidelift.com/subscription/pkg/npm-markdown-it?utm_source=npm-markdown-it&amp;amp;utm_medium=referral&amp;amp;utm_campaign=enterprise&amp;amp;utm_term=repo\">Learn more.</a></p>", "a[href=\"#simple\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Simple<a class=\"headerlink\" href=\"#simple\" title=\"Link to this heading\">#</a></h3><p>Single line rendering, without paragraph wrap:</p>", "a[href=\"#usage-examples\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Usage examples<a class=\"headerlink\" href=\"#usage-examples\" title=\"Link to this heading\">#</a></h2><p>See also:</p>", "a[href=\"../punycode.js/README.html#api\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">API<a class=\"headerlink\" href=\"#api\" title=\"Link to this heading\">#</a></h2><h3><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.decode(string)</span></code><a class=\"headerlink\" href=\"#punycode-decode-string\" title=\"Link to this heading\">#</a></h3><p>Converts a Punycode string of ASCII symbols to a string of Unicode symbols.</p>", "a[href=\"#init-with-presets-and-options\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Init with presets and options<a class=\"headerlink\" href=\"#init-with-presets-and-options\" title=\"Link to this heading\">#</a></h3><p>(*) presets define combinations of active rules and options. Can be\n<code class=\"docutils literal notranslate\"><span class=\"pre\">\"commonmark\"</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">\"zero\"</span></code> or <code class=\"docutils literal notranslate\"><span class=\"pre\">\"default\"</span></code> (if skipped). See\n<a class=\"tippyAnchor reference external\" href=\"https://markdown-it.github.io/markdown-it/#MarkdownIt.new\">API docs</a> for more details.</p>", "a[href=\"#benchmark\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Benchmark<a class=\"headerlink\" href=\"#benchmark\" title=\"Link to this heading\">#</a></h2><p>Here is the result of readme parse at MB Pro Retina 2013 (2.4 GHz):</p>", "a[href=\"#install\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Install<a class=\"headerlink\" href=\"#install\" title=\"Link to this heading\">#</a></h2><p><strong>node.js</strong>:</p>", "a[href=\"#manage-rules\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Manage rules<a class=\"headerlink\" href=\"#manage-rules\" title=\"Link to this heading\">#</a></h3><p>By default all rules are enabled, but can be restricted by options. On plugin\nload all its rules are enabled automatically.</p>", "a[href=\"#api\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">API<a class=\"headerlink\" href=\"#api\" title=\"Link to this heading\">#</a></h2><p><strong><a class=\"tippyAnchor reference external\" href=\"https://markdown-it.github.io/markdown-it/\">API documentation</a></strong></p><p>If you are going to write plugins, please take a look at\n<a class=\"tippyAnchor reference external\" href=\"https://github.com/markdown-it/markdown-it/tree/master/docs\">Development info</a>.</p>", "a[href=\"#markdown-it\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">markdown-it <!-- omit in toc --><a class=\"headerlink\" href=\"#markdown-it\" title=\"Link to this heading\">#</a></h1><p><a class=\"tippyAnchor reference external\" href=\"https://github.com/markdown-it/markdown-it/actions/workflows/ci.yml\"><img alt=\"CI\" loading=\"lazy\" src=\"https://github.com/markdown-it/markdown-it/actions/workflows/ci.yml/badge.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.org/package/markdown-it\"><img alt=\"NPM version\" loading=\"lazy\" src=\"https://img.shields.io/npm/v/markdown-it.svg?style=flat\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://coveralls.io/github/markdown-it/markdown-it?branch=master\"><img alt=\"Coverage Status\" loading=\"lazy\" src=\"https://coveralls.io/repos/markdown-it/markdown-it/badge.svg?branch=master&amp;service=github\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://gitter.im/markdown-it/markdown-it\"><img alt=\"Gitter\" loading=\"lazy\" src=\"https://badges.gitter.im/Join%20Chat.svg\"/></a></p>", "a[href=\"#authors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Authors<a class=\"headerlink\" href=\"#authors\" title=\"Link to this heading\">#</a></h2><p><em>markdown-it</em> is the result of the decision of the authors who contributed to\n99% of the <em>Remarkable</em> code to move to a project with the same authorship but\nnew leadership (Vitaly and Alex). It\u2019s not a fork.</p>", "a[href=\"#linkify\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Linkify<a class=\"headerlink\" href=\"#linkify\" title=\"Link to this heading\">#</a></h3><p><code class=\"docutils literal notranslate\"><span class=\"pre\">linkify:</span> <span class=\"pre\">true</span></code> uses <a class=\"tippyAnchor reference external\" href=\"https://github.com/markdown-it/linkify-it\">linkify-it</a>. To\nconfigure linkify-it, access the linkify instance through <code class=\"docutils literal notranslate\"><span class=\"pre\">md.linkify</span></code>:</p>", "a[href=\"#syntax-extensions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Syntax extensions<a class=\"headerlink\" href=\"#syntax-extensions\" title=\"Link to this heading\">#</a></h2><p>Embedded (enabled by default):</p>", "a[href=\"#plugins-load\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Plugins load<a class=\"headerlink\" href=\"#plugins-load\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#references-thanks\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">References / Thanks<a class=\"headerlink\" href=\"#references-thanks\" title=\"Link to this heading\">#</a></h2><p>Big thanks to <a class=\"tippyAnchor reference external\" href=\"https://github.com/jgm\">John MacFarlane</a> for his work on the\nCommonMark spec and reference implementations. His work saved us a lot of time\nduring this project\u2019s development.</p><p><strong>Related Links:</strong></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
